import React from "react";
import styled from "styled-components";
import Button from "../../components/Button";

const HomePresenter = () => {
  return (
    <Container>
      <Text>모임 이름</Text>
    </Container>
  );
};

const Container = styled.div`
  justify-content: center;
  align-items: center;
  display: flex;
  flex-direction: column;
`;

const Text = styled.p`
  margin: 0;
  font-weight: bold;
  font-size: 50px;
  margin-top: 60px;
  margin-bottom: 40px;
`;

export default HomePresenter;
